import React, { useState } from 'react'
import { getDish } from '../../services/dish';


function Dish(props) {
    const { dish } = props;
    const [editDish, setEditDish] = useState();

    const handleDishInput = () => event => {
        const key = event.target.name;
        const value = event.target.value;
        setEditDish({ ...dish, [key]: value });
    }

    const handleDish = (id) => {
        getDish(id)
        .then((res) => {
            console.log(res)
            setEditDish(res);
        })
        .catch((error) => {
            console.log(error);
        })
    }

    const addNewDish = () => {
        // addDish(dish)
        // .then((res) => {
        //     console.log(res)
        // })
        // .catch((error) => {
        //     console.log(error)
        // })
    }

    return (
        <>
            <tr>
                <td>{dish.name}</td>
                <td>{dish.desc.slice(0, 10)}...</td>
                <td>{dish.category}</td>
                <td>{dish.subcategory}</td>
                <td>{dish.price}</td>
                <td>{dish.status}</td>
                <td className='text-center'><button className="btn btn-primary" data-bs-toggle="modal" data-bs-target="#edit" onClick={() => handleDish(dish._id)}>Edit</button></td>
            </tr>

            {/* <!-- Modal --> */}
            <div class="modal fade" id="edit" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
                <div class="modal-dialog">
                    <div class="modal-content">
                        <div class="modal-header">
                            <h5 class="modal-title" id="exampleModalLabel">Add new dish</h5>
                            <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                        </div>
                        <div class="modal-body">

                            <div class="mb-3">
                                <label for="name" class="form-label">Name</label>
                                <input type="text" class="form-control" id="name" name='name' value={ editDish?.name} onChange={handleDishInput()} />
                            </div>
                            <div class="mb-3">
                                <label for="desc" class="form-label">Description</label>
                                <input type="text" class="form-control" id="desc" name='desc' value={editDish?.desc} onChange={handleDishInput()} />
                            </div>
                            <div class="mb-3">
                                <label for="category" class="form-label">Category</label>
                                <input type="text" class="form-control" id="category" name='category' value={editDish?.category} onChange={handleDishInput()} />
                            </div>
                            <div class="mb-3">
                                <label for="subcategory" class="form-label">Sub Vategory</label>
                                <input type="text" class="form-control" id="subcategory" name='subcategory' value={editDish?.subcategory} onChange={handleDishInput()} />
                            </div>
                            <div class="mb-3">
                                <label for="price" class="form-label">Price</label>
                                <input type="text" class="form-control" id="price" name='price' value={editDish?.price} onChange={handleDishInput()} />
                            </div>

                        </div>
                        <div class="modal-footer">
                            <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
                            <button type="button" class="btn btn-primary" onClick={addNewDish}>Save changes</button>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Dish
